import React from "react";

function Card({name, src, likes, item}) {

  console.log(item.name)

  return(
    <template id="item_template">
      <li className="element">
        <button className="element__delete-card" type="button"></button>
        <img className="element__photo" src={item.src} alt="Картинка" />
        <div className="element__title">
          <h2 className="element__text">{item.name}</h2>
          <div className="element__group">
            <button className="element__like" type="button"></button>
            <p className="element__sum">{item.likes.length}</p>
          </div>
        </div>
      </li>
    </template>
  );
}

export default Card;
